window.bookSummaryJSON = "<p>Forty million people in the US have tried Internet dating, which means 40 million people have probably gone on some pretty crappy dates. <i>Not a Match: My True Tales of Online Dating Disasters</i> is about one guy who experienced more than his fair share. Brian Donovan, a writer and comedian whose work has appeared on Late Night with Jimmy Fallon, NPR, and Chapelle's Show, has been on over 100 Internet dates in a genuine search for love and happiness.</p>"; 
